import React from 'react'
import { connect } from 'react-redux'

class Searchbar extends React.Component {
    constructor(props) {
      super();
      this.state = {
        audiocards: [],
        filteredCards: []
        }
      }


}

const mapStateToProps = state => {
    console.log(state)
    return {
        audiocards: state.loginForm
    }
}



export default connect(mapStateToProps)(Searchbar)
